INSERT INTO `kompetensi` (`id`, `kompetensi`, `deskripsi`, `status`, `created_at`, `updated_at`) VALUES
(1, 'ACHIEVEMENT ORIENTATION', 'Mencapai sasaran kerja yang menantang dan prestasi kerja yang lebih baik.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(2, 'ACTION MANAGEMENT', 'Kemampuan mengelola seluruh sumber daya dalam mencapai sasaran perusahaan.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(3, 'ADAPTABILITY', 'Mempertahankan efektivitas perilaku/kerja ketika menghadapi perubahan yang terjadi (lingkungan, prosedur dan orang).', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(4, 'ANALYTICAL THINKING', 'Kemampuan untuk mengidentifikasi sumber-sumber masalah, menggunakan pendekatan berpikir yang logis, sistematis dan teratur secara kronologis.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(5, 'ATTENTION TO DETAIL', 'Kemampuan untuk memproses informasi detil secara efektif dan konsisten.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(6, 'BUILDING PARTNERSHIP', 'Kemampuan dalam menjalin dan mengembangkan hubungan kemitraan yang saling menguntungkan dengan ?client? dan unit kerja sebagai prioritas utama yang menimbulkan sinergi.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(7, 'BUSINESS ACUMEN', 'Kemampuan untuk memanfaatkan peluang dalam memperoleh profit dan mengembangkan aktifitas bisnis perusahaan.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(8, 'BUSINESS AWARENESS', 'Kemampuan untuk memahami perannya dalam pencapaian tujuan bisnis perusahaan.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(9, 'COLLABORATION', 'Mencari cara untuk bekerja secara efektif dengan orang lain, mempertahankan hubungan kerja yang baik antar pribadi.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(10, 'COMMUNICATION', 'Menerima dan menyampaikan informasi lisan maupun tulisan secara efektif untuk menghindari kesalahpahaman.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(11, 'CONCEPTUAL THINKING', 'Kemampuan memahami situasi atau masalah dengan cara memandangnya sebagai satu kesatuan yang terintegrasi.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(12, 'CONTINUOUS IMPROVEMENT', 'Mengembangkan hasil proses-proses dan kondisi yang ada berdasarkan keadaan yang berubah terus menerus.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(13, 'CONTROL', 'Menetapkan prosedur untuk mengendalikan dan atau mengatur aktivitas dan tanggung jawab anak buah; proses untuk memastikan  segala aktifitas yang terlaksana sesuai dengan apa yang telah direncanakan.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(14, 'CUSTOMER FOCUS', 'Secara proaktif memberikan pelayanan yang bernilai tambah dan lebih dari yang diharapkan pelanggan eksternal atau internal.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(15, 'CREATIVITY', 'Kemampuan berpikir untuk menghasilkan solusi, cara atau terobosan dalam bentuk ide, gagasan atau program nyata yang mendukung pencapaian kinerja terbaik perusahaan; menjadikan kendala sebagai tantangan untuk menghasilkan gagasan yang kreatif.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(16, 'DECISION MAKING', 'Kemampuan mengambil tindakan atau keputusan yang efektif untuk menyelesaikan masalah.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(17, 'DELEGATION', 'Menugaskan pekerjaan pada orang lain untuk memaksimalkan waktu dan pengembangan  sumber daya manusia serta sumber daya lain; memberi kepercayaan pada anak buah untuk meningkatkan produktivitas.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(18, 'EMPATHY', 'Mempertimbangkan perasaan dan kebutuhan orang lain saat mengambil tindakan.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(19, 'EMPOWERING', 'Kemampuan memberdayakan staf melalui pemberian wewenang yang lebih besar sehingga mereka merasa lebih mampu dan termotivasi.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(20, 'ENTHUSIASTIC', 'Penuh energi dan hidup, mungkin impulsif, bersemangat, spontan, ceria, mengambil resiko, suka membutuhkan stimulasi-stimulasi dan mencari tantangan, serta cenderung tidak mudah bosan.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(21, 'FAIRNESS TO SUBORDINATE', 'Kemampuan untuk bertindak proporsional terhadap staff', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(22, 'FLEXIBILITY', 'Kemampuan mengubah pola pikir dan pola perilaku dengan mudah dan cepat sejalan dengan keragaman kebutuhan / tuntutan.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(23, 'IMPACT', 'Menunjukan kesan pertama yang baik, mendapatkan perhatian dan penghargaan, menunjukan rasa percaya diri.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(24, 'INITIATIVE', 'Mengambil tindakan yang didasarkan terhadap apa yang seharusnya dilakukan ataupun yang bersifat proaktif  untuk mencapai sasaran.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(25, 'INFORMATION SEEKING', 'Kemauan dan kemampuan untuk mengumpulkan informasi yang berguna dalam penyelesaian pekerjaan.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(26, 'INNOVATION', 'Membuat  dan menerapkan metode penyelesaian yang inovatif untuk mengatasi berbagai tantangan pekerjaan.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(27, 'INTERPERSONAL SKILL', 'Kemampuan untuk mengenali; menginterpretasi dan mengantisipasi minat dan perasaan orang lain, serta mengkomunikasikan pemahaman-pemahaman tersebut berlandaskan empati.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(28, 'LEADERSHIP', 'Menggunakan gaya kepemimpinan dan metoda interpersonal yang tepat dalam mengarahkan individu dan kelompok dalam mencapai tujuan.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(29, 'LEARNING ABILITY', 'Mendapatkan pengetahuan dan keahlian baru dengan cepat dan mudah.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(30, 'LEGAL AWARENESS', 'Kemauan untuk mencari tahu dan kemampuan untuk mengantisipasi resiko hukum dari setiap keputusan-keputusan yang diambil.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(31, 'MANAGING DIVERSITY', 'Kemampuan untuk mengelola dan memanfaatkan keragaman para pemangku kepentingan untuk meningkatkan nilai tambah dan daya saing Perusahaan.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(32, 'MONITORING', 'Melaksanakan berbagai prosedur dan metode untuk mengumpulkan dan mengulas berbagai informasi yang dibutuhkan untuk manajemen yang efektif; kegiatan untuk mengikuti perkembangan suatu program yang dilakukan secara   teratur serta terus menerus.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(33, 'NEGOTIATION', 'Mencapai solusi yang disepakati bersama melalui komunikasi dan membina  hubungan baik dengan pihak-pihak yang terkait.', 1, '2023-12-20 11:28:02', '2023-12-20 11:28:02'),
(34, 'NETWORKING', 'Kemampuan menciptakan dan mendorong serta memelihara hubungan yang kuat dengan organisasi dan \'key person.\'', 1, '2023-12-20 11:28:03', '2023-12-20 11:28:03'),
(35, 'ORGANIZATIONAL AWARENESS', 'Kemampuan menggunakan pengetahuan tentang situasi atau budaya organisasi untuk mengidentifikasi dan mengantisipasi dampak keputusan yang diambil terhadap pihak atau unit lain.', 1, '2023-12-20 11:28:03', '2023-12-20 11:28:03'),
(36, 'PEOPLE DEVELOPMENT', 'Membantu dalam pengembangan pengetahuan dan keahlian staff sehingga mereka dapat bekerja dengan efektif.', 1, '2023-12-20 11:28:03', '2023-12-20 11:28:03'),
(37, 'PERSUASIVENESS', 'Menggunakan gaya dan metoda interpersonal yang tepat dalam berkomunikasi sebagai upaya mencapai persetujuan terhadap ide/pendapat yang disampaikan.', 1, '2023-12-20 11:28:03', '2023-12-20 11:28:03'),
(38, 'PLANNING & ORGANIZING', 'Menetapkan alternatif tindakan baik untuk diri sendiri maupun untuk orang lain dalam mencapai tujuan yang spesifik; merencanakan dan mengalokasikan sumber daya yang ada.', 1, '2023-12-20 11:28:03', '2023-12-20 11:28:03'),
(39, 'RISK TAKING', 'Keberanian mengambil tindakan untuk mencapai keuntungan disertai kesiapan menerima resiko atau akibat negatif yang berpotensi muncul sesuai perhitungan yang dilakukannya.', 1, '2023-12-20 11:28:03', '2023-12-20 11:28:03'),
(40, 'SELF CONFIDENT', 'Tingkat keyakinan akan keberadaan diri di tengah situasi sosial serta memiliki pandangan yang positif terhadap dirinya', 1, '2023-12-20 11:28:03', '2023-12-20 11:28:03'),
(41, 'SELF MANAGEMENT', 'Memiliki kepercayaan diri dan komitmen untuk mengalokasikan waktu, tenaga dan pikiran untuk hal-hal yang sangat prioritas.', 1, '2023-12-20 11:28:03', '2023-12-20 11:28:03'),
(42, 'STRATEGIC ORIENTATION', 'Pemahaman komprehensif tentang berbagai hal yang mempengaruhi arah strategis perusahaan.', 1, '2023-12-20 11:28:03', '2023-12-20 11:28:03'),
(43, 'TEAM WORK', 'Memberikan kontribusi dalam pengembangan dan pencapaian tujuan tim.', 1, '2023-12-20 11:28:03', '2023-12-20 11:28:03'),
(44, 'TENACITY', 'Gigih dalam berusaha dan bertindak hingga tujuan tercapai atau ditinggalkan.', 1, '2023-12-20 11:28:03', '2023-12-20 11:28:03'),
(45, 'TOLERANCE FOR STRESS', 'Kemampuan seseorang untuk bertahan dalam situasi dan kondisi yang penuh tekanan.', 1, '2023-12-20 11:28:03', '2023-12-20 11:28:03');
